import { Idable, IndexOf } from "./types";

export const toIndexOf = <T extends Idable>(items: T[]): IndexOf<T> => {
  const result: IndexOf<T> = {};
  items.forEach(item => {
    result[item.id] = item;
  })
  return result;
}
